	(65, 24, 'chelliandra valerie', 'chelliandra valerie', NULL, '2009-09-23', 'bogor', 151, 57, '0', 'acropolis de karasideman FO 03', '081210260490', 'melanjutkan ekstrakurikuler di skolah lama saya dan saya mempunyai minat ingin melatih kedisiplinan, meningkatkan potensi diri, juga meningkatkan cinta pada tanah air, mengembangkan karakter dan berpartisipasi dalam kegiatan bendera merah putih, karna paskibra juga dapat menjadi wadah untuk melatih mental dan melatih kita secara fisik, melatih kerja sama dan kekompakan dalam organisasi dengan menyatukan hati, juga ingin menjadi salah satu keluarga dari paskibra rajawali, trimakasi', 'izin_687cf7cbf0038_IMG_20250720_204824.jpg', 'sehat_687cf7cbf22e7_IMG_20250720_204913.jpg', 'chelliandracecell@gmail.com', 'SMPN DAARUL ULUUM LIDO', NULL, 'X', NULL, 'foto_687cf7cbf3646_1000192869.jpg', 'Kampus 1', 'lolos', '2508220065', '2025-07-20 14:06:03', NULL),
	(66, 80, 'Dihan Danu Prasetyo', 'Dihan Danu Prasetyo', NULL, '2010-04-09', 'Depok', 165, 42, '0', 'jl h. sara tapos depok', '6281288312379', 'Saya memilih ekstrakurikuler Paskibra karena ingin melatih disiplin, tanggung jawab, dan ketegasan dalam diri saya. Saya juga tertarik dengan kegiatan baris-berbaris dan upacara bendera, serta ingin melatih fisik dan mental agar menjadi pribadi yang lebih kuat. Selain itu, saya ingin meningkatkan kepercayaan diri dan kemampuan kepemimpinan, terutama dalam kerja sama tim. Serta melanjutkan prestasi saya dalam paskibra saat di sekolah sebelumnya..\r\nSaya juga termotivasi oleh kakak kelas yang pernah aktif di Paskibra, karena mereka terlihat keren, rapi, dan memiliki sikap yang patut dicontoh. Harapan saya ke depan, semoga saya bisa berprestasi dan berkesempatan mengikuti seleksi Paskibraka tingkat kota/kabupaten, serta menjadi bagian dari tim yang bisa mewakili dan membanggakan sekolah.', 'izin_687e18bca6855_Surat Izin Ekskul Paskibra_Dihan.pdf', 'sehat_687e18bca6c4e_IMG_9715.jpeg', 'dihandanu9@gmail.com', 'MTs. Nurul Islam', NULL, 'X', NULL, 'foto_687e18bca7622_White Yellow Elegant Minimalist Initial Name Logo.png', 'Kampus 1', 'lolos', '2509190066', '2025-07-21 10:38:52', NULL),
