	(72, 84, 'Agitsni Raisa R', 'Agitsni Raisa Ramadhani', NULL, '2010-08-27', 'Bogor', 159, 48, '0', 'Pabuaran Asri 2 Blok B No 3', '6281295142431', 'saya ingin membentuk pribadi yang lebih disiplin dan bertanggung jawab, sekaligus melatih jiwa kepemimpinan, memperkuat mental, serta memperluas relasi dan pengalaman. Saya percaya Paskibra Rajawali adalah wadah yang tepat untuk mengembangkan itu semua. Selain itu, rasa kekeluargaan dan kebersamaan yang kuat di dalamnya juga menjadi motivasi bagi saya untuk bergabung dengan Taruna Rajawali', 'izin_687f9bde5a743_IMG_20250722_210412.jpg', 'sehat_687f9bde5c192_IMG_20250722_210606.jpg', 'araisar27@gmail.com', 'MTsN Kota Depok', NULL, 'X', NULL, 'foto_687f9bde5d646_IMG-20250417-WA0014.jpg', 'Kampus 1', 'lolos', '2508170072', '2025-07-22 14:10:38', NULL),
